import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate and click the first product card to open the modal
    const firstProductCard = page.locator('.product-card').first();
    await firstProductCard.click();

    // Wait for the modal to become visible
    const modalLocator = page.locator('#productModal');
    await modalLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot with the modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract the title from the product detail modal to verify
    const modalTitle = await page.locator('.product-detail-title').textContent();
    const isModalVisible = await modalLocator.isVisible();

    if (!isModalVisible) {
      throw new Error('Product detail modal did not become visible after clicking the product card.');
    }

    return {
      success: true,
      action: "Clicked on the first product card and successfully opened the product detail modal.",
      extractedData: {
        modalTitle: modalTitle.trim(),
        isModalVisible: isModalVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
